  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115598 includes chemical,
  discrete sample, physical and profile data collected from OCEAN RESEARCHER I in
  the Philippine Sea from 1991-06-26 to 1991-07-04 and retrieved during cruise PACIFICA_21OR19910626.
  These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12),
  DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE
  and WATER TEMPERATURE. The instruments used to collect these data include CTD and
  bottle. These data were collected by Cho-Teng Lui and Su-Cheng Pai of National Taiwan
  University as part of the PACIFICA_21OR19910626 data set.nnPACIFICA (PACIFic ocean
  Interior CArbon) was an international collaborative project for the data synthesis
  of ocean interior carbon and its related parameters in the Pacific Ocean. The North
  Pacific Marine Science Organization (PICES), Section of Carbon and Climate (S-CC)
  supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
